import { Component } from "@angular/core";

import { Platform } from "@ionic/angular";

import { Plugins, Capacitor } from "@capacitor/core";
import { ExpensesService } from './expenses/expenses.service';

@Component({
  selector: "app-root",
  templateUrl: "app.component.html"
})
export class AppComponent {
  constructor(private platform: Platform) {
    this.initializeApp();
  }

  initializeApp() {
    this.platform.ready().then(() => {
      if (Capacitor.isPluginAvailable("SplashScreen")) {
        Plugins.SplashScreen.hide();
      }
    });

    let demoImage: string =
      "data:image/jpeg;base64,";
    let demoImage2: string =
      "data:image/jpeg;base64,";
    let demoImage3: string =
      "data:image/jpeg;base64,";

    var demoEl1 = [
      "0",
      "Lunch Out",
      "Super Tasty Lobster Thermidor",
      "Subsistence",
      demoImage,
      10,
      true,
      new Date(2019, 0, 1, 12, 0)
    ];
    var demoEl2 = [
      "1",
      "Greggs",
      "Something Cheap",
      "Subsistence",
      demoImage2,
      2,
      true,
      new Date(2019, 4, 12, 14, 0)
    ];
    var demoEl3 = [
      "2",
      "Cheeky Kebab",
      "Something Spicey",
      "Subsistence",
      demoImage3,
      4,
      false,
      new Date(2019, 0, 3, 16, 0)
    ];
    if(!localStorage.getItem("1")){
      console.log("Setting demo data");
      localStorage.setItem("0", JSON.stringify(demoEl1));
      localStorage.setItem("1", JSON.stringify(demoEl2));
      localStorage.setItem("2", JSON.stringify(demoEl3));
    } else {
      console.log("No need to set demo data.");
    }

  }

  onLogout() {}
}
